pub enum Coordinates<'a, Size: ModulusSize> {
    Identity,
    Compact {
        x: &'a GenericArray<u8, Size>,
    },
    Compressed {
        x: &'a GenericArray<u8, Size>,
        y_is_odd: bool,
    },
    Uncompressed {
        x: &'a GenericArray<u8, Size>,
        y: &'a GenericArray<u8, Size>,
    },
}
